      return this.props.arrSeat.map((item) => {
        return <DiagramSeat />;
      });
    };
    return <div></div>;
  }
}

const mapStateToProps = (rootReducer) => {
  return {
    arrSeat: rootReducer.seatReducer,
  };
};

export default connect(mapStateToProps)(DiagramSeat);
